export class Book extends Component {

    constructor(props){
        super(props);
        this.state={books:[]}
    }
    refreshList(){
        fetch("https://localhost:44305/api/Books")
        .then(response => response.json())
        .then(data => {
            this.setState({books:data})
        })   
    }

    componentDidMount(){
        this.refreshList();
    }

    render() {
        const {books} = this.state;
